import React from "react";
import ReactDOM from "react-dom";

const fname = "anil";
const lname = "sharma";


ReactDOM.render(
    <>
        <h1> My Name is {fname} {lname}</h1>
        <h1> My Name is {fname + " " + lname}</h1>
        <h1> My Name is {`${fname} ${lname}`}</h1>
        <h1>  {`My first Name is ${fname} and my Last name is ${lname}`}</h1>
        <p> My age is {18 + 3} </p>
    </>,
    document.getElementById('root')
);

